import myimg from "./images/man1.jpg";
import myimg2 from "./images/woman.jpg";
import myimg3 from "./images/man2.jpg";

const data = [
    {
        student_name: "Ben Floyer",
        class: "BSCS",
        college: "Aspire",
        marks: 776.83,
        Image: myimg
    },

    {
        student_name: "kathe taylor",
        class: "BS Commerce",
        college: "Punjab",
        marks: 976.83,
        Image: myimg2
    },

    {
        student_name: "guptil ben",
        class: "BSIT",
        college: "Concordia",
        marks: 796.83,
        Image: myimg3
    }
]


export default data;
